style.css:
/* Пример изменения цветовой палитры для сайта Roblox */
/* Фоновый цвет страницы */
body {
  background-color: #ffe5b4; /* Песочный цвет фона */
}

/* Заголовки */
h1, h2, h3 {
  color: #ff6347; /* Красный цвет для заголовков */
}

/* Текст */
p {
  color: #d2691e; /* Шоколадный цвет для текста */
}

/* Ссылки */
a {
  color: #ff4500; /* Оранжевый цвет для ссылок */
}

/* Кнопки */
button {
  background-color: #ffa500; /* Оранжевый цвет для кнопок */
  color: white;
}

